Another way of avoiding re-entrancy-related attacks is to follow the so-called CEI pattern. CEI stands for "Checks, Effects, Interactions", meaning that the contract code should first perform safety checks, also known as "pre-conditions", then perform effects, i.e. modify or read the contract storage and execute external contract calls (interaction) only at the very end of the function/method. Please see this blog post for more detail on some vulnerabilities in case of storage modification after interaction and this blog post for more information on storage reads after interaction. The Sway compiler implements a check that the CEI pattern is not violated in the user contract and issues warnings if that's the case. For example, in the following contract the CEI pattern is violated, because an external contract call is executed before a storage write. contract; mod other_contract; use other_contract::*; abi MyContract { #[storage(read, write)] fn withdraw(external_contract_id: ContractId);
} storage { balances: StorageMap<Identity, u64> = StorageMap {},
} impl MyContract for Contract { #[storage(read, write)] fn withdraw(external_contract_id: ContractId) { let sender = msg_sender().unwrap(); let bal = storage.balances.get(sender).try_read().unwrap_or(0); assert(bal > 0); // External call let caller = abi(OtherContract, external_contract_id.into()); caller.external_call { coins: bal }(); // Storage update _after_ external call storage.balances.insert(sender, 0); }
} Here, other_contract is defined as follows: library; abi OtherContract { #[payable] fn external_call();
} The CEI pattern analyzer issues a warning as follows, pointing to the interaction before a storage modification: warning --> /path/to/contract/main.sw:28:9 |
26 |
27 | let caller = abi(OtherContract, external_contract_id.into());
28 | caller.external_call { coins: bal }(); | _________-
29 | |
30 | | // Storage update _after_ external call
31 | | storage.balances.insert(sender, 0); | |__________________________________________- Storage write after external contract interaction in function or method "withdraw". Consider making all storage writes before calling another contract
32 | }
33 | } |
____ In case there is a storage read after an interaction, the CEI analyzer will issue a similar warning. In addition to storage reads and writes after an interaction, the CEI analyzer reports analogous warnings about: balance tree updates, i.e. balance tree reads with subsequent writes, which may be produced by the tr and tro asm instructions or library functions using them under the hood; balance trees reads with bal instruction; changes to the output messages that can be produced by the __smo intrinsic function or the smo asm instruction.

